import React, { Component } from 'react';
import logo from '../logo.jpeg';

class Header extends Component {
    render() {
        return (
            <h1><a href=""><img src={logo} alt="FESTIVAL DE CANNES" /></a></h1>
        );
    }
}

export default Header;
